import * as S from "./styles";
import { FiLogIn, FiLogOut } from "react-icons/fi";
import { FiShoppingCart } from "react-icons/fi";

export const Header: React.FC = () => {
  return (
    <S.StyledHeader>
      <S.Wraper>
        <S.HeaderTitle>MyShop.</S.HeaderTitle>

        <S.ButtonsWrapper>
          <S.AuthButton>
            {isLogged}
            <FiLogIn />
          </S.AuthButton>
          <S.CartButton>
            Carrinho
            <FiShoppingCart />
          </S.CartButton>
        </S.ButtonsWrapper>
      </S.Wraper>
    </S.StyledHeader>
  );
};
